import PostList from "../Components/PostList";
import { useState, useEffect } from "react";
import axios from 'axios';

const AllPosts = () => {
    const[posts, setPosts] = useState([{
        id:'',
        title: '',
        description:''
}])

    useEffect(() =>{
        axios.get("/posts").then((res)=>{
          setPosts(res.data);
        })
    })
    
    return ( 
       <PostList posts={posts} />
     );
}
 
export default AllPosts
;
